  false,\n\t\"url\": null,\n\t\"notes\": \"In May 2014, staff at the San Bernardino
  National Wildlife Refuge (SBNWR) requested the production of a vegetation map to
  document the ongoing restoration of the refuge.  Utilizing object-based image analysis
  (OBIA) a 9 class vegetation map was produced.  This was a piloted effort to develop
  a simple, repeatable and low-cost land cover mapping framework that could be carried
  out on other refuges.  Thus, iterative steps were taken and refined as part of the
  mapping process.  This document has a Digital Object Identifier: http://dx.doi.org/10.7944/W3WC7M\",\n\t\"license_title\":
